    body:
      '–ê –ø–æ –ø–æ–≤–æ–¥—É –∏–∫–æ–Ω–æ–∫, –µ—Å–ª–∏ –Ω—É–∂–Ω–∞ –±—É–¥–µ—Ç –∫–∞—Å—Ç–æ–º–∫–∞, —Ç–æ –ø–ª–µ–≤–∞—Ç—å—Å—è –±—É–¥—É—Ç –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª–∏ –∏–∑-–∑–∞ —Ç–≤–æ–µ–≥–æ —Ä–µ—à–µ–Ω–∏—è. –í —Ç–∞–∫–æ–º —Å–ª—É—á–∞–µ –¥–∞–∂–µ –Ω–µ –≠–ª–µ–º–µ–Ω—Ç –Ω–∞–¥–æ –ø—Ä–∏–Ω–∏–º–∞—Ç—å, –∞ —Ñ—É–Ω–∫—Ü–∏—é –∫–æ—Ç–æ—Ä–∞—è –≤ –∫–∞—á–µ—Å—Ç–≤–µ –∞—Ä–≥—É–º–µ–Ω—Ç–∞ –ø—Ä–∏–Ω–∏–º–∞–µ—Ç —Ä–∞–∑–º–µ—Ä –∏ –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç —ç–ª–µ–º–µ–Ω—Ç. –ò —Ç–æ–≥–¥–∞ –∫–æ–Ω–µ—á–Ω—ã–π –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –≤–∏–¥–∂–µ—Ç–∞ –±—É–¥–µ—Ç –≤ —Å–ª—É—á–∞–µ –∫–∞—Å—Ç–æ–º–∫–∏ —Å–∞–º –æ–ø–∏—Å—ã–≤–∞—Ç—å —Å–≤–æ–π –∫–æ–º–ø–æ–Ω–µ–Ω—Ç –∏–∫–æ–Ω–∫–∏ –∫–æ—Ç–æ—Ä—ã–π –±—É–¥–µ—Ç –º–µ–Ω—è—Ç—å—Å—è –≤ –∑–∞–≤–∏—Å–∏–º–æ—Å—Ç–∏ –æ—Ç —Ä–∞–∑–º–µ—Ä–∞ –≤–∏–¥–∂–µ—Ç–∞. –í–æ—Ç —ç—Ç–æ –±–æ–ª–µ–µ —É–¥–æ–±–Ω–æ–µ API.\r\n\r\nAndrey Izmaylov \r\n–ø—Ä–æ –∏–∫–æ–Ω–∫–∏. –ú—ã —Ö–æ—Ç–∏–º —á—Ç–æ–± –¥–∏–∑–∞–π–Ω–µ—Ä—ã —Å—Ä–∞–∑—É –≥–æ—Ç–æ–≤–∏–ª–∏ –∏–∫–æ–Ω–∫–∏ –≤ –Ω—É–∂–Ω–æ–º —Ñ–æ—Ä–º–∞—Ç–µ, –∏ —ç—Ç–æ—Ç –∂–µ —Ñ–æ—Ä–º–∞—Ç –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–ª—Å—è —É —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫–æ–≤. –£ –Ω–∞—Å –µ—Å—Ç—å –∏–Ω—Å—Ç—Ä—É–∫—Ü–∏—è –∫–∞–∫ –≥–æ—Ç–æ–≤–∏—Ç—å –∏–∫–æ–Ω–∫–∏\r\nhttps://consta-uikit.vercel.app/?path=/docs/components-icons--playground\r\n\r\nAleksey Fedorov\r\n–¢–æ–ª—å–∫–æ –≤–æ—Ç —ç—Ç–æ–π –∏–Ω—Å—Ç—Ä—É–∫—Ü–∏–∏ –Ω–µ—Ç –≤ —ç—Ç–æ–º —Ä–µ–ø–æ–∑–∏—Ç–æ—Ä–∏–∏, –∞ –ø–æ–∫–∞ –µ–µ –Ω–µ—Ç –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –º–æ–∂–µ—Ç –¥–æ–±–∞–≤–ª—è—Ç—å –∫–∞–∫—É—é –µ–º—É –≤–∑–¥—É–º–∞–µ—Ç—Å—è –∏–∫–æ–Ω–∫—É.\r\n–í–∞–º –±—ã —Ä–µ—à–∏—Ç—å –ø—Ä–æ–±–ª–µ–º—É —Å –¥–æ–∫–∞–º–∏, —è–≤–Ω–æ –µ—Å—Ç—å –∫–∞–∫–∞—è-—Ç–æ –æ–±—â–∞—è —á–∞—Å—Ç—å –∫–æ—Ç–æ—Ä–∞—è –∫–∞—Å–∞–µ—Ç—Å—è –≤—Å–µ—Ö UI –ø—Ä–æ–µ–∫—Ç–æ–≤ –∫–æ—Ç–æ—Ä—É—é –±—ã –≤—ã–¥–µ–ª–∏—Ç—å –≤ –æ—Ç–¥–µ–ª—å–Ω—ã–π —Ä–µ–ø–æ–∑–∏—Ç–æ—Ä–∏–π –∏ —à–∞—Ä–∏—Ç—å –º–µ–∂–¥—É –ø—Ä–æ–µ–∫—Ç–∞–º–∏.\r\n–ï—Å–ª–∏ –∑–∞—Ö–æ–¥–∏—Ç—å –≤ –ø—Ä–æ–µ–∫—Ç—ã –ì–∞–∑–ø—Ä–æ–º–∞ —á–µ—Ä–µ–∑ –≤–∏–¥–∂–µ—Ç—ã, —Ç–æ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –Ω–∏–∫–æ–≥–¥–∞ –Ω–µ —É–∑–Ω–∞–µ—Ç –∫–∞–∫ –≥–æ—Ç–æ–≤–∏—Ç—å –∏–∫–æ–Ω–∫–∏. –ü–æ–∫–∞ –∫ –Ω–µ–º—É –Ω–µ –ø—Ä–∏–π–¥—É—Ç –∏ –Ω–µ —Å–∫–∞–∂—É—Ç, —á—Ç–æ –æ–Ω –¥–µ–ª–∞–µ—Ç —á—Ç–æ-—Ç–æ –Ω–µ —Ç–∞–∫.',
