    body:
      "–ü—Ä–∏ —Å–æ–∑–¥–∞–Ω–∏–∏ –∫–∞—Å—Ç–æ–º–Ω–æ–≥–æ –ø—Ä–µ—Å–µ—Ç–∞ –Ω–µ —Ä–∞—Å—Å—á–∏—Ç—ã–≤–∞—é—Ç—Å—è —Ü–≤–µ—Ç–æ–≤—ã–µ –ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ —Ü–≤–µ—Ç–æ–≤–æ–π —Ç–µ–º—ã. –í–∞–¥–∏–º –≥–æ–≤–æ—Ä–∏–ª, —á—Ç–æ –Ω–∞ –ª–µ–Ω–¥–æ—Å–µ –∫–∞–∫-—Ç–æ —Ä–µ—à–∏–ª–∏ —ç—Ç—É –ø—Ä–æ–±–ª–µ–º—É. –ù—É–∂–Ω–æ –≤ —Ü–µ–ª–æ–º –ø–æ—Ä–µ—Å–µ—Ä—á–∏—Ç—å —ç—Ç—É –∏—Å—Ç–æ—Ä–∏—é, –ø–æ—Ç–æ–º—É —á—Ç–æ –Ω–∞—à–∏ —Ç–µ–º—ã –∏–∑ –∫–æ—Ä–æ–±–∫–∏ –º–∞–ª–æ –∫–æ–º—É –Ω—É–∂–Ω—ã –±—É–¥—É—Ç.\r\n\r\n–°—Ç–æ–∏—Ç —É—á–∏—Ç—ã–≤–∞—Ç—å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ Consta —Å create-react-app –±–µ–∑ —ç–¥–∂–µ–∫—Ç–∞, –≥–¥–µ webpack –Ω–µ–¥–æ—Å—Ç—É–ø–µ–Ω –Ω–∞–ø—Ä—è–º—É—é. –Ø –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–ª —Å–∫—Ä–∏–ø—Ç, –Ω–µ —É–≤–µ—Ä–µ–Ω, —á—Ç–æ —Ä–µ—à–µ–Ω–∏–µ —ç–ª–µ–≥–∞–Ω—Ç–Ω–æ–µ\r\n\r\n```\r\n...\r\n\"scripts\": {\r\n    ...\r\n    \"start\": \"yarn colors && react-scripts start\",\r\n    \"colors\": \"node ./utils/calculateColorVariables.js\"\r\n  },\r\n...\r\n```\r\n```\r\nvar fs = require('fs')\r\nvar postcss = require('postcss')\r\nvar colorFunction = require('postcss-color-function')\r\nvar simpleVars = require('postcss-simple-vars')\r\nvar calculate = (importFilePath, exportFilePath) => {\r\n  var css = fs.readFileSync(importFilePath, 'utf8')\r\n  var output = postcss([simpleVars, colorFunction]).process(css).css\r\n  fs.writeFileSync(exportFilePath, output)\r\n}\r\nvar itemsToCalculate = [\r\n  {\r\n    importFilePath: './src/themes/_color/_Theme_color_customDefault.css',\r\n    exportFilePath: './src/themes/_color/Theme_color_customDefault.css',\r\n  },\r\n...\r\n]\r\nitemsToCalculate.forEach((item) =>\r\n  calculate(item.importFilePath, item.exportFilePath)\r\n)\r\n```\r\n",
